import { Dropdown, Menu, Input } from "antd";
import { DownOutlined } from "@ant-design/icons";

import { BookFilled, PlusOutlined } from "@ant-design/icons";



const StudyPlanCard: React.FC = () => {
    const dummyModuleCodes: string[] = [
        "CS1101s", "CS2030", "CS2040", "CS1231", "CS3219"
    ];

    const dummyModuleCodeMenu = (
        <Menu>
            <Menu.Item>CS3203</Menu.Item>
            <Menu.Item>LAK1001</Menu.Item>
            <Menu.Item>GER1000</Menu.Item>
        </Menu>
    );

    const renderModuleCodes = () => dummyModuleCodes.map(moduleCode => {
        return (
            <div style={styles.moduleCode}>
                {moduleCode}
            </div>
        );
    });

    return (
        <div style={styles.container}>
            <div style={styles.header}>
                <div style={styles.title}>
                    <BookFilled style={{ ...styles.actionIcon }} />
                        StudyPlan
                    </div>
                <div style={styles.selector}>
                    <Dropdown overlay={dummyModuleCodeMenu}>
                        <div>
                            Y1S1
                            <DownOutlined />
                        </div>
                    </Dropdown>
                    <PlusOutlined style={{ marginLeft:10 }}/>
                </div>
            </div>
            <div style={styles.moduleList}>
                {renderModuleCodes()}
            </div>
        </div>

    );
};

const styles = {
    moduleCode: {
        padding: 12,
        backgroundColor: "#2D538C",
        color: "#fff",
        borderRadius: 15,
        boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.25)",
        marginRight: 10
    },
    moduleList: {
        display: "flex",
        justifyContent: "flex-start",
        flexWrap: "wrap"
    },
    container: {
        padding: 30,
        backgroundColor: "#76CCB7",
        color: "#fff",
        borderRadius: 15,
        boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.25)",
        marginBottom: 15,
        marginRight:10,
        display:"flex",
        flexDirection:"column",
    },
    header: {
        display: "flex",
        justifyContent: "space-between",
        fontSize: 20,
        alignItems: "center",
        margin: "-5px 0px 10px 0px"
    },
    title: {
        textDecorationLine: "underline",
        fontWeight: "bold",
    },
    actionIcon: {
        height: 20,
        marginRight: 10,
        color: "#fff"
    },
    selector: {
        display:"flex",
        alignItems: "center",
        fontSize:15
    }


};

export default StudyPlanCard;
